def concatenate(strings: List[str]) -> str:
    """ Concatenate list of strings into a single string
    >>> concatenate([])
    ''
    >>> concatenate(['a', 'b', 'c'])
    'abc'
    """
    if len(strings) == 0:
        return ''

    if isinstance(strings, str):
        return''.join(strings)

    for string in strings:
        if isinstance(string, str):
            return''.join([string,''.join(strings)])

    return ''

